column13:
The present invention provides a method of minimizing synchronization delay in a radiotelephone system between a modular subscriber cluster communicating with a common base station, the modular subscriber cluster receiving repetitive time slots from the base station and having a plurality of frequency-agile modems, the method comprising the steps of: 
synchronizing a selected one of the modems to a selected time slot of the received time slots; 
generating a frame sync signal from said selected modem; and distributing said frame sync signal to remaining ones of the plurality of modems.
